import React, { useState, useEffect } from 'react';
import './rentalform.css';
import $ from 'jquery';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Dropdown } from 'react-bootstrap';
import { date } from 'joi';

const RentalRequest = () => {

    const dateNow = new Date();
    const dayNow = dateNow.getDate();
    const monthNow = dateNow.getMonth() + 1; // Months are zero-indexed in JS 
    const yearNow = dateNow.getFullYear();

    const [selectedDay, setSelectedDay] = useState(dayNow);
    const [selectedMonth, setSelectedMonth] = useState(monthNow);
    const [selectedYear, setSelectedYear] = useState(yearNow);

    const dateEnd = new Date(); 
    dateEnd.setDate(dateEnd.getDate())
    

    useEffect(() => {
        const $select = $(".1-30");
        if ($select.children().length === 0) {
            for (let i = 1; i <= 30; i++) {
                $select.append($('<option></option>').val(i).html(i));
            }
        }
    }, []);


    useEffect(() => {
        const $select = $(".start-day");
        if ($select.children().length === 0) {
            for (let j = 1; j <= 31; j++) {
                $select.append($('<option></option>').val(j).html(j));
            }
        }
    }, []);

    useEffect(() => {
        const $select = $(".end-day");
        if ($select.children().length === 0) {
            for (let k = 1; k <= 31; k++) {
                $select.append($('<option></option>').val(k).html(k));
            }
        }
    }, []);


    useEffect(() => {
        const $select = $(".start-month");
        const months = [
            "January", "February", "March", "April", "May", "June",
            "July", "August", "September", "October", "November", "December"
        ];
        if ($select.children().length === 0) {
            for (let j = 0; j < 12; j++) {
                $select.append($('<option></option>').val(j + 1).html(months[j]));
            }
        }
    }, []);

    useEffect(() => {
        const $select = $(".end-month");
        const months = [
            "January", "February", "March", "April", "May", "June",
            "July", "August", "September", "October", "November", "December"
        ];
        if ($select.children().length === 0) {
            for (let k = 0; k < 12; k++) {
                $select.append($('<option></option>').val(k + 1).html(months[k]));
            }
        }
    }, []);


    useEffect(() => {
        const $select = $(".start-year");
        const startYear = 2024;
        const endYear = 2034;
        const years = Array.from({ length: endYear - startYear + 1 }, (_, i) => startYear + i);

        if ($select.children().length === 0) {
            years.forEach(year => {
                $select.append($('<option></option>').val(year).html(year));
            });
        }
    }, []);

    useEffect(() => {
        const $select = $(".end-year");
        const startYear = 2024;
        const endYear = 2034;
        const years = Array.from({ length: endYear - startYear + 1 }, (_, i) => startYear + i);
        if ($select.children().length === 0) {
            years.forEach(year => {
                $select.append($('<option></option>').val(year).html(year));
            });
        }
    }, []);


    const [pricePerDay, setPricePerDay] = useState(6);
    const [countOfDaysRental, setCountOfDaysRental] = useState(8);


    return (
        <div className='rental-form-bg'>

            <h2>Rental Request</h2>

            {/* info from popup button transfer */}

            <p>Price per day: <span className='price-per-day'>{pricePerDay}</span></p>
            {/* info from products.json transfer */}

            <form>
                <div>
                    <label>Quantity:</label>
                    <select className="1-30"></select>
                </div>

                <div>
                    <label>Start Date:</label>
                    <select className='start-day' aria-selected={dayNow}></select><select className='start-month' value={monthNow}></select><select className='start-year'></select>
                </div>

                <div>
                    <label>End Date:</label>
                    <select className='end-day'></select><select className='end-month'></select><select className='end-year'></select>
                </div>

                <p>Number of days: <input type='text' className='count-days-value' value={countOfDaysRental}></input></p>

                <p>Total cost of rental: USD <input type='text' className='total-cost-rental'></input></p>

                <button type='submit' className='btn btn-warning'>Submit</button>
            </form>

        </div>
    )
}

export default RentalRequest;
